INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("リリ", 1, 0, 24001, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 40011, 2, 1, 125801);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("クリア", 1, 0, 24001, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 40011, 2, 1, 126001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("プレシア", 1, 0, 24001, 323, "んーと。\nこれ、あげる。\nはい", 3, 40011, 2, 1, 126101);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("リリ", 2, 0, 24001, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, 40011, 2, 1, 125801);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("クリア", 2, 0, 24001, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 40011, 2, 1, 126001);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES ("プレシア", 2, 0, 24001, 326, "お兄。\nきてくれて、うれしい", 6, 40011, 2, 1, 126101);
